int BinaryMatrix::get(int x, int y)
{
    return binaryMatrix[x][y];
}

vector<int> BinaryMatrix::dimensions()
{
    vector<int> dimensions;
    dimensions.push_back(binaryMatrix.size());
    dimensions.push_back(binaryMatrix[0].size());
    return dimensions;
}

