    BinaryMatrix binaryMatrix;
    vector<int> dimensions = binaryMatrix.dimensions();
    int row_size = dimensions[0];
    int col_size = dimensions[1];

    // int calls = 0;
    int row_value = 0;
    int col_value = col_size - 1;
    int min_col = col_size + 1;
    int p = binaryMatrix.get(row_value, col_value);
